var love;

function LoveJs() {
    this.vetImagens = [];
    this.vetNames = [];
    this.qtdeImagens = 0;
    this.lastTic = 0; 
            
    this.draw = function() { };
    this.keyDown = function(event) { };
	this.keyUp = function(event) { };
    this.update = function(time) { };
    this.init = function() { };
    
    this.createLayer = function(w, h) 
	{
        this.canvas = document.createElement('canvas');

        this.canvas.id = "ljs-canvas";
        this.canvas.width = w;
        this.canvas.height = h;
        this.canvas.style.width = w + "px";
        this.canvas.style.height = h + "px";
        this.canvas.style.position = "absolute";
        this.canvas.style.border = "1px solid black";

        var body = document.getElementsByTagName("body")[0];
        body.appendChild(this.canvas);
        this.canvas = document.getElementById("ljs-canvas");
        this.ctx = this.canvas.getContext("2d");
    };    
    
    this.start = function(width,height) {
        this.createLayer(width,height);    
        this.loadImages();
        document.onkeydown = function(event) { love.keyDown(event); }
		document.onkeyup = function(event) { love.keyUp(event); }
    }
    
    this.addImage = function(alias, filename) {
        this.vetNames[alias] = filename;
    }
    
    this.loadImages = function() {
        //alert(Object.keys(love.vetNames).length);
        this.loadImagesRec(Object.keys(love.vetNames).length-1);
    }
    
    this.loadImagesRec = function(qtde) {
        if(qtde < 0) {
            setInterval(love.draw, 40);
            setInterval(love.update, 40);
            return;
        }
        var imgAlias = Object.keys(love.vetNames)[qtde];
        this.vetImagens[imgAlias] = new Image();
        this.vetImagens[imgAlias].src = this.vetNames[imgAlias];
        this.vetImagens[imgAlias].onload = function() {
            love.loadImagesRec(qtde-1);
        }
    }    
    
    this.darwtext = function(text,x,y) {
        this.ctx.fillText(text,x,y);        
    }
    
    this.drawImage = function(alias,x,y) {
        this.ctx.drawImage(this.vetImagens[alias],x,y);
    }
    
    this.drawImageSprite = function(alias,x,y,frameX, frameY, frameW, frameH) {
        this.ctx.drawImage(this.vetImagens[alias],frameX,frameY,frameW,frameH,x,y,frameW,frameH);
    }
    
    this.getTime = function() {
        var clock = new Date();
        return clock.getTime();
    }
    
    this.getDt = function() {
        var tic = this.getTime();
        var dt = tic - this.lastTic;
        this.lastTic = tic;
        return dt/100;
    }
    
    this.createSound = function(fileName) {
        // SM2 has loaded, API ready to use e.g., createSound() etc.
        var sound = soundManager.createSound({
            url: fileName
        });      
        return sound;
    }

}

function Sprite(imageName, frameW, frameH, frameLen, animTime) {
    this.imageName = imageName;
    this.frameWidth = frameW;
    this.frameHeight = frameH;
    this.frameLenght = frameLen;
    this.frame = 0;
    this.dtTime = 0;
    this.animTime = animTime;
    this.lastTic = 0;
	this.stopped = true;
    
    this.update = function() 
	{
		if(!this.stopped)
		{
			this.dtTime = this.dtTime + this.getDt();
			if(this.dtTime > this.animTime) 
			{
				this.dtTime = 0;
				this.frame++;
				if(this.frame >= this.frameLenght)
					this.frame = 0;
			}
		}
    }
    
    this.draw = function(x,y) 
	{
        var sx = this.frame*this.frameWidth;
        love.drawImageSprite(this.imageName,x,y,sx,0,this.frameWidth,this.frameHeight);
    }
    
    this.getTime = function() 
	{
        var clock = new Date();
        return clock.getTime();
    }

    this.getDt = function() 
	{
        var tic = this.getTime();
        var dt = tic - this.lastTic;
        this.lastTic = tic;
        return dt;
    }
	
	this.stop = function() 
	{
        this.stopped = true;
		this.frame = 0;
    }
	
	this.play = function() 
	{
        this.stopped = false;
    }

    this.getFrameHeight = function()
    {
    	return this.frameHeight;
    }

    this.getFrameWidth = function()
    {
    	return this.frameWidth;
    }

    this.destroy = function()
    {
    	delete this;
    }

    this.goToFrameAndStop = function(frame)
    {
    	if(frame <= this.frameLenght)
    	{
			this.stopped = true;
			this.frame = frame;
    	}
    }
    
}

love = new LoveJs();

$(function() {
    soundManager.setup({

        // where to find the SWF files, if needed
        url: './',

        onready: function() {
            love.init();
        },

        ontimeout: function() {
          // Uh-oh. No HTML5 support, SWF missing, Flash blocked or other issue
        }

    });    
});